import React from "react";
import mchammer from "../../img/test/mchammer.gif";
import divider from "../../img/test/divider4.gif";
import fire from "../../img/flames.gif";
import selfIcon from "../../img/self_image.png";
import Header from "./Header";

const Icon = () => {
  return <img src={selfIcon} alt="icon of myself"></img>;
};

const McHammer = () => {
  return <img src={mchammer} alt="gif of mchammer" className="hammer"></img>;
};

const Main = () => {
  return (
    <div className="container">
      <Header />
      <div className="page-header"></div>
    </div>
  );
};

export default Main;
